def find_prime_elements(S):
    """"""
    prime_elements = []
    for i in range(len(S)):
        is_prime = True
        for j in range(len(S)):
            if i != j and S[i] % S[j] == 0:
                is_prime = False
                break
        if is_prime:
            prime_elements.append(S[i])
    return prime_elements
